import React, {Component, Fragment} from 'react';
import HomeSlider from '../component/Homeslider';


class HomePage extends Component{
   Homeslid(){
    <HomeSlider />
   }
   render(){
        return (
            <Fragment>
                <div>
                    <h3>{this.Homeslid}</h3>
                </div>
            </Fragment>
)
}
}

export default HomePage;
